import React, { useEffect, useRef, useState } from 'react';
import { Dropdown } from 'react-bootstrap';
import FeatherIcon from 'feather-icons-react';
import { Nav, Navbar, Container } from 'react-bootstrap';
import { useSelector } from 'react-redux';
import { Link } from 'react-router-dom';

// store
import { RootState } from '../../redux/store';
import profileImg from '../../assets/images/users/avatar-1.jpg';
// images
import logoDark from '../../assets/images/logo-dark.png';
import logoLight from '../../assets/images/logo-light.png';

const NavBar = () => {
    const { user, userLoggedIn } = useSelector((state: RootState) => ({
        user: state.Auth.user,
        loading: state.Auth.loading,
        error: state.Auth.error,
        userLoggedIn: state.Auth.userLoggedIn,
    }));

    // on scroll add navbar class
    useEffect(() => {
        // manage scroll
        const navbar = document.getElementById('nav-menu');
        window.addEventListener('scroll', (e) => {
            e.preventDefault();
            if (navbar) {
                if (document.body.scrollTop >= 50 || document.documentElement.scrollTop >= 50) {
                    navbar.classList.add('nav-sticky', 'shadow');
                } else {
                    navbar.classList.remove('nav-sticky', 'shadow');
                }
            }
        });
    }, []);

    const ProfileMenus = [
        {
            label: 'My Account',
            icon: 'user',
            redirectTo: '/pages/profile',
        },
        {
            label: 'Settings',
            icon: 'settings',
            redirectTo: '/',
        },
        {
            label: 'Support',
            icon: 'help-circle',
            redirectTo: '/',
        },
        {
            label: 'Lock Screen',
            icon: 'lock',
            redirectTo: '/auth/lock-screen',
        },
        {
            label: 'Logout',
            icon: 'log-out',
            redirectTo: '/auth/logout',
        },
    ];

    const [dropdownOpen, setDropdownOpen] = useState<boolean>(true);

    /*
     * toggle dropdown
     */
    const toggleDropdown = () => {
        setDropdownOpen(!dropdownOpen);
    };

    return (
        <>
            <Navbar collapseOnSelect expand={'lg'} className="py-lg-2 mb-2 sticky-top" id="nav-menu">
                <Container>
                    <div className="auth-logo me-lg-5">
                        <Link to="/" className="logo logo-dark">
                            <span className="logo-lg">
                                <img src={logoDark} alt="" className="me-2" height="24" />
                            </span>
                        </Link>

                        <Link to="/" className="logo logo-light">
                            <span className="logo-lg">
                                <img src={logoLight} alt="" className="me-2" height="24" />
                            </span>
                        </Link>
                    </div>

                    <Navbar.Toggle
                        className="shadow-none border-0 px-0 text-dark"
                        aria-controls="responsive-navbar-nav">
                        <i className="uil uil-bars"></i>
                    </Navbar.Toggle>

                    <Navbar.Collapse id="responsive-navbar-nav">
                        {/* left menu */}
                        <Nav as="ul" className="me-auto align-items-center"></Nav>

                        {/* right menu */}
                        <Nav as="ul" className="ms-auto align-items-lg-center fs-16 fw-bold">
                            <Nav.Item as="li" className="mx-lg-1">
                                <img src={profileImg} onClick={toggleDropdown} alt="" title="Mat Helme" className="rounded-circle avatar-md"/>
                                <Dropdown show={dropdownOpen}>
                                    <Dropdown.Menu className="user-pro-dropdown m-0">
                                        {/* <div onClick={toggleDropdown}> */}
                                        {(ProfileMenus || []).map((item, index) => {
                                            return (
                                                <React.Fragment key={index + '-profile-menu'}>
                                                    {index === ProfileMenus.length - 1 && <div className="dropdown-divider"></div>}
                                                    <Link to={item.redirectTo} className="dropdown-item notify-item">
                                                        <FeatherIcon icon={item.icon} className="icon-dual icon-xs me-1" />
                                                        <span>{item.label}</span>
                                                    </Link>
                                                </React.Fragment>
                                            );
                                        })}
                                        {/* </div> */}
                                    </Dropdown.Menu>
                                </Dropdown>
                            </Nav.Item>
                            <Nav.Item as="li" className="mx-lg-1">
                                {userLoggedIn || user ? (
                                    <Nav.Link as={Link} to="/auth/logout" className="text-dark link-demos">
                                        Logout
                                    </Nav.Link>
                                ) : (
                                    <Nav.Link as={Link} to="/auth/login" className="text-dark link-demos">
                                        Login
                                    </Nav.Link>
                                )}
                            </Nav.Item>
                        </Nav>
                    </Navbar.Collapse>
                </Container>
            </Navbar>
        </>
    );
};

export default NavBar;
